import React, { Component } from 'react'
import { listEmployee } from "../../redux/actions/Employee_list";
import { connect } from 'react-redux';
import { Collapse, Form, Button, Tabs, Layout, Input, TextArea, List } from 'antd';


class EmployeeList extends Component {

    componentDidMount() {
        this.props.dispatch(listEmployee())

    }


    render() {

        // const data = [this.props.empList];
        //console.log(data.id);

        console.log("AAA" + JSON.stringify(this.props.empList));

        let partners = this.props && this.props.empList.length > 0 ?
            this.props.empList.map(p =>
                <li className="partners" key={p.id}>
                    {p.name} </li>
            ) : <span></span>;

        return (
            <div>
                <ul>{partners}</ul>
            </div>
        );
    }
}
function mapStateToProps(state) {
    return {

        empList: state.empList.result

    };
}
export default connect(mapStateToProps)(EmployeeList);
